import React from "react";
import { Form } from "../UI/Form";
import { RegistrationStartingValues } from "../../constants/formInputsValues";
import { StyledFormContainer } from "./Styled";

export const Register: React.FC = () => {
  return (
    <StyledFormContainer>
      <div>
        <SectionTitle>
          Join the community to create and share your custom quizzes
        </SectionTitle>
      </div>
      <Form
        scope="register"
        title="register"
        inputs={RegistrationStartingValues}
      />
    </StyledFormContainer>
  );
};
